import React from 'react'
import Header from './header'
import '../CSS/Rbuilder.css'
import Resume_img1 from '../images/resume_img1.jpg'

export default function Rbuilder() {
  return (
    <div>
      <Header/>

          <img src={Resume_img1} alt="..." class="img-thumbnail"/>
          <img src={Resume_img1} className="img-fluid shadow-100"  alt="Responsive image"></img>
   

    </div>
  )
}
